DROP VIEW IF EXISTS `v_tasklist`;
CREATE ALGORITHM=UNDEFINED DEFINER=`db_user`@`localhost` SQL SECURITY DEFINER VIEW `v_tasklist` AS select `a`.`ID_` AS `TASK_ID`,`a`.`PROC_INST_ID_` AS `PROC_INST_ID`,`a`.`TASK_DEF_KEY_` AS `ACT_ID`,`a`.`NAME_` AS `ACT_NAME`,`a`.`ASSIGNEE_` AS `ASSIGNEE`,`a`.`DELEGATION_` AS `DELEGATION_ID`,`a`.`DESCRIPTION_` AS `DESCRIPTION`,`a`.`CREATE_TIME_` AS `CREATE_TIME`,`a`.`DUE_DATE_` AS `DUE_DATE`,`i`.`USER_ID` AS `CANDIDATE` from (`act_ru_task` `a` left join `v_usertask` `i` on((`a`.`ID_` = `i`.`TASK_ID_`))) ;

-- ----------------------------
-- View structure for v_usertask
-- ----------------------------
DROP VIEW IF EXISTS `v_usertask`;
CREATE ALGORITHM=UNDEFINED DEFINER=`db_user`@`localhost` SQL SECURITY DEFINER VIEW `v_usertask` AS select `i`.`TASK_ID_` AS `TASK_ID_`,`i`.`USER_ID_` AS `USER_ID` from (`act_ru_identitylink` `i` join `act_ru_task` `t`) where ((`i`.`TASK_ID_` is not null) and (`i`.`USER_ID_` is not null) and (`i`.`TASK_ID_` = `t`.`ID_`) and isnull(`t`.`ASSIGNEE_`) and (`i`.`TYPE_` = 'candidate')) union select `i`.`TASK_ID_` AS `TASK_ID_`,`r`.`user_id` AS `USER_ID` from ((`act_ru_identitylink` `i` join `sys_user_role` `r`) join `act_ru_task` `t`) where ((`i`.`TASK_ID_` is not null) and (`i`.`GROUP_ID_` is not null) and (`i`.`TASK_ID_` = `t`.`ID_`) and isnull(`t`.`ASSIGNEE_`) and (`i`.`TYPE_` = 'candidate') and (`i`.`GROUP_ID_` = `r`.`role_id`)) ;
